def cleanList(stringAux):
    stringAux = stringAux.replace(',', '\n')
    stringAux = stringAux.replace('[', '')
    stringAux = stringAux.replace(']', '')
    stringAux = stringAux.replace("'", "")
    stringAux = stringAux.replace(" ", "")
    stringAux = stringAux.replace("*", " ")
    return stringAux